import React from 'react'
import './Info.css'
const Info = () => {
    return(
        <div className="infocontainer">
            <div className="Info">
                <h1 className="InfoTitle">Sensor info</h1>
                <img className="infoImage" src="https://img.icons8.com/nolan/128/info.png"/>
            </div>
        </div>
        
    )
}

export default Info
